DROP TABLE IF EXISTS `emploees_messages`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `emploees_messages` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `from_emploee_id` bigint unsigned NOT NULL COMMENT 'Ссылка на отправителя сообщения',
  `to_emploee_id` bigint unsigned NOT NULL COMMENT 'Ссылка на отправителя сообщения',
  `body` text NOT NULL COMMENT 'Текст сообщения',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `emploees_messages_from_emploee_id_fk` (`from_emploee_id`),
  KEY `emploees_messages_to_emploee_id_fk` (`to_emploee_id`),
  CONSTRAINT `emploees_messages_from_emploee_id_fk` FOREIGN KEY (`from_emploee_id`) REFERENCES `emploees` (`id`) ON DELETE CASCADE,
  CONSTRAINT `emploees_messages_to_emploee_id_fk` FOREIGN KEY (`to_emploee_id`) REFERENCES `emploees` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Сообщения';
/*!40101 SET character_set_client = @saved_cs_client */;

