DROP TABLE IF EXISTS `experiences`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `experiences` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `emploee_id` bigint unsigned NOT NULL COMMENT 'Идентификатор строки работника',
  `org_name` varchar(100) NOT NULL COMMENT 'Название организации',
  `title` varchar(100) DEFAULT NULL COMMENT 'Должность в организации',
  `description` text COMMENT 'Описание работы в организации',
  `from_at` date NOT NULL COMMENT 'Дата начала работы',
  `to_at` date DEFAULT NULL COMMENT 'Дата окончания работы',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `experiences_emploee_id_fk` (`emploee_id`),
  CONSTRAINT `experiences_emploee_id_fk` FOREIGN KEY (`emploee_id`) REFERENCES `emploees` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Опыт работников';
/*!40101 SET character_set_client = @saved_cs_client */;

