--
-- Table structure for table `vacancies`
--

DROP TABLE IF EXISTS `vacancies`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `vacancies` (
  `id` bigint unsigned NOT NULL AUTO_INCREMENT,
  `emploee_id` bigint unsigned NOT NULL COMMENT 'Ссылка работника инициатора вакансии',
  `org_id` bigint unsigned NOT NULL COMMENT 'Ссылка от какой компании вакансия',
  `description` text NOT NULL COMMENT 'Текст описания вакансии',
  `title` varchar(255) NOT NULL COMMENT 'Должность',
  `salary_from` int DEFAULT NULL COMMENT 'Начало вилки зарплаты',
  `salary_to` int DEFAULT NULL COMMENT 'Конец вилки зарплаты',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Время создания строки',
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`),
  KEY `vacancies_emploee_id_fk` (`emploee_id`),
  KEY `vacancies_org_id_fk` (`org_id`),
  CONSTRAINT `vacancies_emploee_id_fk` FOREIGN KEY (`emploee_id`) REFERENCES `emploees` (`id`) ON DELETE CASCADE,
  CONSTRAINT `vacancies_org_id_fk` FOREIGN KEY (`org_id`) REFERENCES `organizations` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=128 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='Вакансии';
/*!40101 SET character_set_client = @saved_cs_client */;

